import React, { useEffect, useRef, useState } from 'react';
import gsap from 'gsap';
import { ScrollTrigger } from 'gsap/ScrollTrigger';

import './App.css';
import logo from './img/logo.png';
import hero1 from './img/hero_1.jpg';
import hero2 from './img/hero_2.jpg';
import hero3 from './img/hero_3.jpg';
import hero4 from './img/hero_4.jpg';
import hero5 from './img/hero_5.jpg';
import imgsq5 from './img/img_long_5.jpg';
import imgsq1 from './img/img_sq_1.jpg';
import img1 from './img/img_sq_1.jpg';
import img2 from './img/img_sq_3.jpg';
import img3 from './img/img_sq_4.jpg';
import img4 from './img/img_sq_5.jpg';
import img5 from './img/img_sq_6.jpg';
import img6 from './img/img_sq_8.jpg';
gsap.registerPlugin(ScrollTrigger);
function App() {
  const [currentIndex, setCurrentIndex] = useState(0);
  const [currentIndex2, setCurrentIndex2] = useState(0);
  const imgRef = useRef(null);
  const conImg = useRef(null);
  const images = [hero1, hero2, hero3, hero4, hero5];
  const images2 = [img4, img2, img3, img1, img5, img6];
  useEffect(() => {
    let tl = gsap.timeline();
    tl.fromTo(".logo", {
      y: -80,
      opacity: 0,
    },
      {
        y: 0,
        duration: 1,
        opacity: 1
      })
    tl.fromTo("li", {
      y: -40,
      opacity: 0
    },
      {
        y: 0,
        duration: 1,
        opacity: 1,
        delay: -0.5,
        stagger: 0.1
      }
    )
  }, [])

  useEffect(() => {
    gsap.fromTo(".textM", {
      y: -50,
      opacity: 0
    },
      {
        y: 0,
        opacity: 1,
        duration: 0.9,
        delay: 0.5
      }
    )

    gsap.fromTo(".textMM", {
      y: -50,
      opacity: 0
    },
      {
        y: 0,
        opacity: 1,
        duration: 1,
        delay: 0.5
      }
    )
    gsap.fromTo("#partImg", {
      scale: 1.2,
      opacity: 0
    },
      {
        scrollTrigger: {
          trigger: '.container1',
          scroller: 'body',
          markers: false,
          start: "top 80%",
          end: "top 60%"
        },
        opacity: 1,
        scale: 1,
        duration: 0.5,
        delay: 0.5
      }
    )
    gsap.fromTo(".part2", {
      y: 100,
      opacity: 0
    },
      {
        scrollTrigger: {
          trigger: '.container1 ',
          scroller: 'body',
          markers: false,
          start: "top 80%",
          end: "top 60%"
        },
        y: 0,
        opacity: 1,
        duration: 0.5,
        delay: 0.5
      }
    )
    gsap.fromTo(".section1", {
      y: 100,
      opacity: 0
    },
      {
        y: 0,
        opacity: 1.4,
        duration: 0.8,
        delay: 0.4
      })
    gsap.fromTo(".section2", {
      scale: 1.2,
      opacity: 0
    },
      {
        scale: 1,
        opacity: 1,
        duration: 1
      })
  })

  let imgLen = images.length;
  let imgLen2 = images2.length;
  const slideLeft = () => {
    let newIndex1 = currentIndex === 0 ? imgLen - 1 : currentIndex - 1;
    setCurrentIndex(newIndex1);
    let valueP = -newIndex1 * window.innerWidth;
    gsap.to(imgRef.current, {
      x: valueP,
      duration: 1,
      delay: 0.1
    });
